function ref_doc() {
    //Pega o tamanho da tela para deixar o site responsivo//
    var wwidth = $(window).width();
    
        if(wwidth >= 1440) {
    
            $('#center').removeClass();
            $('#center').addClass('col-sm-6');
    
            $('#left').removeClass('col-sm-2');
            $('#left').addClass('col-sm-3');
    
        } else if (wwidth >= 1024) {
    
            $('#center').removeClass();
            $('#center').addClass('col-sm-6');
    
            $('#left').removeClass('col-sm-2');
            $('#left').addClass('col-sm-3');
    
        } else if (wwidth >= 768) {
    
            $('#center').removeClass();
            $('#center').addClass('col-sm-8');
    
            $('#left').removeClass('');
            $('#left').css('display', 'none');
    
            $('#right').removeClass('');
            $('#right').addClass('col-sm-4');
            
        } else if (wwidth >= 425) {
    
            $('#center').removeClass();
            $('#center').addClass('col-sm-12');
    
            $('#left').removeClass('');
            $('#left').css('display', 'none');
    
            $('#right').removeClass('');
            $('#right').css('display', 'none');
            
        }
}

function fixedEncodeURIComponent (str) {
    return encodeURIComponent(str).replace(/[!'()]/g, escape).replace(/\*/g, "%2A");
  }

$(document)
.one('focus.new-comment-input', 'textarea.new-comment-input', function () {
    var savedValue = this.value;
    this.value = '';
    this.baseScrollHeight = this.scrollHeight;
    this.value = savedValue;
})
.on('input.new-comment-input', 'textarea.new-comment-input', function () {
    var minRows = this.getAttribute('data-min-rows') | 0, rows;
    this.rows = minRows;
    rows = Math.ceil((this.scrollHeight - this.baseScrollHeight) / 20);
    this.rows = minRows + rows;
});

