function reflesh_events() {
    var selected_day = $('.carousel-inner > .carousel-item.active');
    var events_content = $('.events-content');
    var elements = new Array();
    var selected_day_value = selected_day.attr('date');
    var processing_view = $('<div class="loading-events-display"><div class="content"><div class="processing-dots-panel"><div class="content"><div class="dots-container" id="processing-event-dots-container"><div class="dot"></div><div class="dot"></div><div class="dot"></div></div></div></div></div></div>');
    
    if($('.events-content > .loading-events-display').length) {
        $('.events-content > .loading-events-display').css('display', 'none');
    } else {
        processing_view.appendTo(events_content);
    }

    var e = $('.events-content').each(function (index, value) {
        elements[index] = $(this).find('.event').attr('date');
    });

    if($.inArray(selected_day_value, elements)) {
            
        var iurl = location.href;
        iurl = 'http://' + iurl.split("/")[2];
    
        $.ajax({
            type: "POST",
            url: iurl + "/events/aj_event_loader.php",
            data: "GET_EVENTS_DATE=" + selected_day_value,
            dataType: 'html',
            beforeSend: function() {
                $('.events-content > .loading-events-display').css('display', 'block');
                animateDots();
            }
        })
        .done(function(msg) {
            $('.events-content > .loading-events-display').css('display', 'none');
            
            if(msg !== '') {

                events_content.empty();

                $(msg.substring(msg.indexOf('<div'))).appendTo(events_content);

            } else {

                events_content.empty();

            }

        })
        .fail(function (jqXHR, textStatus, msg) {
            console.error("Request failed: " + textStatus);
        });
        
        }
}

    function animateDots() {

        var dots = document.querySelectorAll('.dot')
        var colors = ['rgba(0, 0, 0, 0.50);', 'rgba(0, 0, 0, 0.50);', 'rgba(0, 0, 0, 0.50);']

        for (var i = 0; i < dots.length; i++) {
            dynamics.animate(dots[i], {
                //translateY: -15,
                scale: 1.7,
                backgroundColor: colors[i]
            }, {
                type: dynamics.forceWithGravity,
                bounciness: 800,
                elasticity: 200,
                duration: 2000,
                delay: i * 150
            })
        }
  
        dynamics.setTimeout(animateDots, 2500)
    }

    if($('#top-menu-user').length) {
        var offset = $('#top-menu-user').offset().top;
        var menu = $('#top-menu-user');
        var left_content = $('.left-content');
        var user_button_menu = $('.user-buttom-menu');
        var user_content_info = $('.user-info-top-menu-user');
        $(document).on('scroll', function () {
            if (offset <= $(window).scrollTop()) {
                menu.addClass('fixed');
                user_content_info.css('display', 'flex');
                left_content.addClass('col-sm-3');
                left_content.css('position', 'fixed');
                left_content.css('width', '100%');
                left_content.css('top', '50px');
                left_content.css('padding-right', '10px');
                user_button_menu.css('top', '3px');
            } else {
                menu.removeClass('fixed');
                user_content_info.css('display', 'none');
                left_content.removeClass('col-sm-3');
                left_content.css('position', 'relative');
                left_content.css('width', '100%');
                left_content.css('top', '');
                left_content.css('padding-right', '0px');
                user_button_menu.css('top', '10px');
            }
        });
    }

